import { Line } from 'react-chartjs-2'

import styled from 'styled-components'
import { color } from '../public/screensizes'


const Trend = props => {
  const data = {
    datasets: [{
      data: [4, 8, 6, 9, 11, ],
      // backgroundColor: [ color.jctOrange, 'rgba(0,0,0, .05)' ],
      // borderWidth: 1
    }]
  }

  return(
    <Graph>
      <Line
        data={ data }
        />
    </Graph>
  )
}

export default Trend

const Graph = styled.div`
  width: 100%;
  height: 10rem;
`
